	  private class UpdatePositions implements Runnable {
		    private final TLcdDataObjectIndexedAnd2DBoundsIndexedModel model;
		    private final IndexId indexId;

		    public UpdatePositions( TLcdDataObjectIndexedAnd2DBoundsIndexedModel aModel,
		                            IndexId aIndexId ) {
		      model = aModel;
		      indexId = aIndexId;
		    }

		    @Override
		    public void run() {
		      try {
		        String response = apiGETData(hashTag);
		        Collection<Tweet> positions = new TwitterPositionsParser().unmarshall( response );

		        long count=0;
		        // Make sure to get a write lock before modifying the model.
		        try ( TLcdLockUtil.Lock lock = TLcdLockUtil.writeLock( model ) ) {
		          for ( Tweet t : positions ) {
		            Tweet object = ( Tweet ) model.retrieveFirstByIndex( indexId, Collections.singletonList( t.getText() ) );

		            // If this vehicle is not yet known in our model (SPTrans API does not always return the same set of vehicles).
		            if ( null == object ) {
		              model.addElement( t, ILcdModel.FIRE_LATER );
		              count++;
		            }
		            else {    // If the vehicle, is known, update its position.
		              // The vehicles are polylines, where the last point is the latest position. So we just append the new
		              // position at the end of the polyline.
		              object.insert2DPoint( object.getPointCount(), t.getX( 0 ), t.getY( 0 ) );
		              model.elementChanged( object, ILcdModel.FIRE_LATER );
		            }
		          }
		          System.out.println("Qtd de tweets novos: "+count);
		          
		        }
		        finally {
		          SwingUtilities.invokeLater( model::fireCollectedModelChanges );
		        }
		      }
		      catch ( Exception aE ) {
		        // Something went wrong.
		        aE.printStackTrace();
		      }
		    }
		  }
	

